// client/src/components/PilotLicensesList.jsx

import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Form.css';

export default function PilotLicensesList() {
  const [licenses, setLicenses] = useState([]);
  const [loading,  setLoading]  = useState(false);
  const [error,    setError]    = useState('');

  const fetchLicenses = async () => {
    setLoading(true);
    try {
      const res = await axios.get('/api/pilot_licenses');
      setLicenses(res.data);
      setError('');
    } catch (err) {
      setError(err.response?.data?.error || 'Failed to load licenses');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchLicenses();
  }, []);

  return (
    <div className="view-container">
      <h2>Pilot Licenses</h2>
      <button
        className="refresh-btn"
        onClick={fetchLicenses}
        disabled={loading}
      >
        {loading ? 'Loading…' : 'Refresh'}
      </button>
      {error && <p className="error-text">{error}</p>}
      <table className="data-table">
        <thead>
          <tr>
            <th>Person ID</th>
            <th>License</th>
          </tr>
        </thead>
        <tbody>
          {licenses.map((lic, idx) => (
            <tr key={`${lic.personID}-${lic.license}-${idx}`}>
              <td>{lic.personID}</td>
              <td>{lic.license}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
